import React, { Component } from 'react';
import styled from 'styled-components';

const ContentStyle = styled.div`
  background-color: #091A45;
  width: 100%;
`;

class Content extends Component {
  render() {
    return (
      <ContentStyle>
        <h1>hello</h1>
      </ContentStyle>
    );
  }
}

export default Content;
